import React from 'govuk-react';
import { Page } from 'govuk-react';
import { TopNav } from '@govuk-react/top-nav';



function MyHeader() {
    return (
        
        <Page>
        
                <TopNav
                    company={<TopNav.Anchor href="https://example.com" target="new"><TopNav.IconTitle icon={<Crown height="32" width="36" />}>GOV.UK</TopNav.IconTitle></TopNav.Anchor>}
                    serviceTitle={<TopNav.NavLink href="https://example.com" target="new">Service Title</TopNav.NavLink>}
                />
                <div>
                    <h2 class="pageTitle">Medical Records</h2>
                </div> 
        
        </Page>

    );

}


export default MyHeader;
